protected void seek(long term, short res) {
  if (term < currStart && res < maxShift) {
    throw new IllegalArgumentException("trying to seek backwards");
  } else if (term == currStart) {
    return;
  }
  shift = res;
  currStart = term;
  currEnd = currStart | ((1L<<shift)-1);
  withinOnly = false;
}

